class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        dicts = {}
        left = 0
        right = 0
        ans = 0
        while right < len(s):
            ch = s[right]
            if ch not in dicts.keys():
                dicts[ch] = 0
            dicts[ch] += 1
            right += 1

            while dicts[ch] > 1:
                dicts[s[left]] -= 1
                left += 1

            ans = max(ans, right - left)
        return ans


